import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import PrivateRoute from './components/PrivateRoute';
import AnnotatorDashboard from './components/AnnotatorDashboard';
import DataSpecialistDashboard from './components/DataSpecialistDashboard';
import { AuthProvider } from './context/AuthContext';

function App() {
  return (
    <AuthProvider>
      <Router>
        <div>
          <nav>
            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/login">Login</Link>
              </li>
              <li>
                <Link to="/register">Register</Link>
              </li>
            </ul>
          </nav>

          <hr />

          <Routes>
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/annotator" element={<PrivateRoute role="annotator"><AnnotatorDashboard /></PrivateRoute>} />
            <Route path="/data-specialist" element={<PrivateRoute role="data_specialist"><DataSpecialistDashboard /></PrivateRoute>} />
            <Route path="/" element={<h2>Home</h2>} />
          </Routes>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
